const LEVEL_MUD = 2;
const LEVEL_SAND = 1;
const LEVEL_ICE = 0;

function Level(numRows, numCols)
{
    this.numRows = numRows;
    this.numCols = numCols;
    this.track = [];
    this.waypoints = [];
}

var createNewLevel = function()
{
    var numRows = 20;
    var numCols = 20;
    
    var track = Array(numRows * numCols).fill(TRACK_ROAD);
    
    // Fill the left / right borders with wall
    for (var i = 0; i < numRows; i++)
    {
        track[i * numCols] = TRACK_WALL;  // Left border
        track[(i + 1) * numCols - 1] = TRACK_WALL;  // Right border
    }

    // Fill the bottom / up borders with wall
    for (var j = 0; j < numCols; j++)
    {
        track[j] = TRACK_WALL;  // Up border
        track[(numRows - 1) * numCols + j] = TRACK_WALL;  // Bottom border
    }

    // Place a player start at the center
    var startIdx = (numRows + 1) * numCols / 2;
    track[startIdx] = TRACK_START;

    var levelData = {
        "laps":2,
        "numRows":numRows,
        "numCols":numCols,
        "track":track,
        "firstWaypoint":null
    };

    return JSON.stringify(levelData);
}

